import React from 'react';
import {
    
    FormPicker as Picker,
    
  } from "../../components/forms";
  import sepecialitePickerItem from "../../components/CategoryPickerItem";



const categories = [
    {
      backgroundColor: "#fc5c65",
      icon: "karate",
      label: "karate",
      value: 1,
    },
    {
      backgroundColor: "#fd9644",
      icon: "football",
      label: "Rugby",
      value: 2,
    },
    {
      backgroundColor: "#fed330",
      icon: "swim",
      label: "Swiming",
      value: 3,
    },
    {
      backgroundColor: "#26de81",
      icon: "basketball-hoop-outline",
      label: "basket_ball",
      value: 4,
    },
    {
      backgroundColor: "#2bcbba",
      icon: "dumbbell",
      label: "Body_bulding",
      value: 5,
    },
    {
      backgroundColor: "#45aaf2",
      icon: "basketball",
      label: "foot_ball",
      value: 6,
    },
    {
      backgroundColor: "#4b7bec",
      icon: "hockey-sticks",
      label: "hockey",
      value: 7,
    },
    {
      backgroundColor: "#a55eea",
      icon: "run-fast",
      label: "Run_Fast",
      value: 8,
    },
    {
      backgroundColor: "#778ca3",
      icon: "application",
      label: "judo",
      value: 9,
    },
  ];

function Specialite1(props) {
    return (
        <Picker
          items={categories}
          name="speciality"
          numberOfColumns={3}
          PickerItemComponent={sepecialitePickerItem}
          placeholder="Spécialité"
          
          width="50%"
        />  
    );
}

export default Specialite1;
